class ContextMenu extends HTMLElement{connectedCallback(){const Header=null!=this.attributes.Header?this.attributes.Header.value:"",Url=null!=this.attributes.Url?this.attributes.Url.value:"#";setTimeout(()=>this.outerHTML='<div style="'+this.style.cssText+'" class="fluent-context-menu-container" style=""><a href="'+Url+'">'+Header+'</a><div class="fluent-context-menu"><ul class="fluent-menu-list">'+this.innerHTML+"</ul></div></div>")}}customElements.define("fluent-contextmenu",ContextMenu);class MenuItem extends HTMLElement{connectedCallback(){setTimeout(()=>{this.hasAttribute("selectable")?this.outerHTML='<li><a class="fluent-menu-item-select"'+AttributesToString(this)+">"+this.innerHTML||"</a></li>":this.outerHTML='<li><a class="fluent-menu-item"'+AttributesToString(this)+">"+this.innerHTML||"</a></li>"})}}customElements.define("fluent-menu-item",MenuItem);class MenuItemExpander extends HTMLElement{connectedCallback(){const Header=null!=this.attributes.Header?this.attributes.Header.value:"";setTimeout(()=>{this.hasAttribute("expanded")?this.outerHTML='<div style="'+this.style.cssText+'" class="fluent-menu-item-expander"><div class="fluent-menu-item-expander-header" '+(null!=this.attributes.icon?'icon="'+this.attributes.icon.value+'"':"")+"><p>"+Header+'</p><div><img class="fluent-menu-item-expander-arrow" style="transform: rotate(180deg)" src="https://resources.bexcool.eu/fluentwebframework/src/img/arrow_down.svg"></div></div><div class="fluent-menu-item-expander-body-container"><div class="fluent-menu-item-expander-body expanded">'+this.innerHTML+"</div></div></div>":this.outerHTML='<div style="'+this.style.cssText+'" class="fluent-menu-item-expander"><div class="fluent-menu-item-expander-header" '+(null!=this.attributes.icon?'icon="'+this.attributes.icon.value+'"':"")+"><p>"+Header+'</p><div><img class="fluent-menu-item-expander-arrow" src="https://resources.bexcool.eu/fluentwebframework/src/img/arrow_down.svg"></div></div><div class="fluent-menu-item-expander-body-container"><div class="fluent-menu-item-expander-body">'+this.innerHTML+"</div></div></div>"})}}customElements.define("fluent-menu-item-expander",MenuItemExpander);class Expander extends HTMLElement{connectedCallback(){const Header=null!=this.attributes.Header?this.attributes.Header.value:"";setTimeout(()=>{this.hasAttribute("expanded")?this.outerHTML='<div style="'+this.style.cssText+'" class="fluent-expander"><div class="fluent-expander-header"><p>'+Header+'</p><div><img class="fluent-expander-arrow" style="transform: rotate(180deg)" src="https://resources.bexcool.eu/fluentwebframework/src/img/arrow_down.svg"></div></div><div class="fluent-expander-body-container"><div class="fluent-expander-body expanded">'+this.innerHTML+"</div></div></div>":this.outerHTML='<div style="'+this.style.cssText+'" class="fluent-expander"><div class="fluent-expander-header"><p>'+Header+'</p><div><img class="fluent-expander-arrow" src="https://resources.bexcool.eu/fluentwebframework/src/img/arrow_down.svg"></div></div><div class="fluent-expander-body-container"><div class="fluent-expander-body">'+this.innerHTML+"</div></div></div>"})}}customElements.define("fluent-expander",Expander);class Border extends HTMLElement{connectedCallback(){setTimeout(()=>this.outerHTML='<div style="'+this.style.cssText+'" class="fluent-background-border">'+this.innerHTML+"</div>")}}customElements.define("fluent-border",Border);class ToggleButton extends HTMLElement{connectedCallback(){setTimeout(()=>this.outerHTML='<button style="'+this.style.cssText+'" class="fluent-button">'+this.innerHTML+"</button>")}}customElements.define("fluent-togglebutton",ToggleButton);class Menu extends HTMLElement{connectedCallback(){setTimeout(()=>this.outerHTML='<div class="fluent-menu"'+AttributesToString(this)+'><ul class="fluent-menu-list">'+this.innerHTML+"</ul></div></div>")}}customElements.define("fluent-menu",Menu);class MainContent extends HTMLElement{connectedCallback(){setTimeout(()=>this.outerHTML='<div class="fluent-main-content"'+AttributesToString(this)+">"+this.innerHTML+"</div>")}}customElements.define("fluent-main-content",MainContent);class Button extends HTMLElement{connectedCallback(){setTimeout(()=>{this.hasAttribute("accent")&&(this.outerHTML='<a class="fluent-button-accent" href="#"'+AttributesToString(this)+" >"+this.innerHTML+"</a>")})}}customElements.define("fluent-button",Button);class Label extends HTMLElement{connectedCallback(){setTimeout(()=>{this.outerHTML='<span class="fluent-label"'+AttributesToString(this)+" >"+this.innerHTML+"</span>"})}}customElements.define("fluent-label",Label);class ContentDialog extends HTMLElement{connectedCallback(){setTimeout(()=>{this.outerHTML='<div class="fluent-content-dialog-background"><div class="fluent-content-dialog" '+AttributesToString(this)+">"+this.innerHTML+"</div></div>"})}}customElements.define("fluent-content-dialog",ContentDialog);